  const handleClose3 = () => setOpen3(false);

  const handleClose4 = () => {
    setOpen3(false);
    setChecked2(false);
    setOpen4(true);
  };

  const handleClose5 = () => {
    setOpen4(false);
    navigate("/Login");
  };

  const handleClickShowPassword = (i) => {
    if (i === 1) {
      if (type === "password") {
        setValues(!values);
        setType("text");
      } else if (type === "text") {
        setValues(!values);
        setType("password");
      }
    } else if (i === 2) {
